import React from 'react';
import { Table } from "react-bootstrap";

function TriangleDimensions () {
    return (
        <div>
            
            <Table bordered>
                <thead>
                    <tr>
                        <th colspan="2">
                            Triangle Dimensions
                        </th>
                    </tr>
                    <tr>
                        <th>
                            Side/Angle
                        </th>
                        <th>
                            Measurement
                        </th>
                    </tr>
                </thead>
            </Table>
        </div>
    );
};

export default TriangleDimensions;
